INSERT INTO `portal_notices` (`id`, `title`, `description`, `title_bn`, `description_bn`, `attachment`, `status`, `user_id`, `created_at`, `updated_at`) VALUES
(11, 'বিস্ময়কর ভাস্কর্য ভাংচুরের প্রতি বিবাদে মানবাধিকার ও প্রতিবাদ সমাবেশ', 'Human rights and protest rallies against the vandalism of wonderful sculpturesHuman rights and protest rallies against the vandalism of wonderful sculptures', 'বিস্ময়কর ভাস্কর্য ভাংচুরের প্রতি বিবাদে মানবাধিকার ও প্রতিবাদ সমাবেশ', 'বিস্ময়কর ভাস্কর্য ভাংচুরের প্রতি বিবাদে মানবাধিকার ও প্রতিবাদ সমাবেশবিস্ময়কর ভাস্কর্য ভাংচুরের প্রতি বিবাদে মানবাধিকার ও প্রতিবাদ সমাবেশ', '1632222437.jpeg', 1, 1, '2021-09-21 05:07:17', '2021-09-21 05:08:20'),
(12, 'DAP Surrey price reduced by Tk 9 per kg; The actual savings is 18 rupees', 'DAP Surrey price reduced by Tk 9 per kg; The actual savings is 18 rupeesDAP Surrey price reduced by Tk 9 per kg; The actual savings is 18 rupees', 'ডিএপি সারে কেজিতে দাম কমলো ৯ টাকা; প্রকৃত সাশ্রয় ১৬ টাকা', 'ডিএপি সারে কেজিতে দাম কমলো ৯ টাকা; প্রকৃত সাশ্রয় ১৬ টাকা, 	ডিএপি সারে কেজিতে দাম কমলো ৯ টাকা; প্রকৃত সাশ্রয় ১৬ টাকা', '1632222645.jpeg', 1, 1, '2021-09-21 05:10:45', '2021-09-21 05:10:45'),
(13, 'The first prizes received by BADC in various fairs held in 2019 were handed over to the Hon\'ble Minister of Agriculture', 'The first prizes received by BADC in various fairs held in 2019 were handed over to the Hon\'ble Minister of AgricultureThe first prizes received by BADC in various fairs held in 2019 were handed over to the Hon\'ble Minister of Agriculture', '২০১৯ সালে অনুষ্ঠিত বিভিন্ন মেলায় বিএডিসি প্রাপ্ত প্রথম পুরস্কারসমূহ মাননীয় কৃষি মন্ত্রীর নিকট হস্তান্তর	', '২০১৯ সালে অনুষ্ঠিত বিভিন্ন মেলায় বিএডিসি প্রাপ্ত প্রথম পুরস্কারসমূহ মাননীয় কৃষি মন্ত্রীর নিকট হস্তান্তর	,২০১৯ সালে অনুষ্ঠিত বিভিন্ন মেলায় বিএডিসি প্রাপ্ত প্রথম পুরস্কারসমূহ মাননীয় কৃষি মন্ত্রীর নিকট হস্তান্তর	', '1632222687.jpg', 1, 1, '2021-09-21 05:11:27', '2021-09-21 05:11:27');
INSERT INTO `portal_services` (`id`, `name`, `name_bn`, `component_id`, `service_category_id`, `description`, `description_bn`, `anual_duration`, `anual_duration_bn`, `process`, `form_attachment`, `applied_service`, `received_service`, `target_customer`, `image`, `service_url`, `created_by`, `updated_by`, `status`, `is_featured`, `apply_or_view`, `created_at`, `updated_at`) VALUES
(26, 'Irrigation Water Quality Testing', 'সেচের পানির গুণাগুণ পরীক্ষা', 9, 8, 'কৃষি জমিতে ব্যবহার্য সেচ পানি অথবা খাবার পানির গুনাগুন যাচাইয়ের জন্য আবেদন করতে পারবেন। এক্ষেত্রে, পরীক্ষমান পানির নমুনা প্রদান পূর্বক প্রয়োজনীয় তথ্য ও ফি প্রদান করে পানির গুনাগুণের রিপোর্ট সংগ্রহ করা যাবে।\r\n', 'কৃষি জমিতে ব্যবহার্য সেচ পানি অথবা খাবার পানির গুনাগুন যাচাইয়ের জন্য আবেদন করতে পারবেন। এক্ষেত্রে, পরীক্ষমান পানির নমুনা প্রদান পূর্বক প্রয়োজনীয় তথ্য ও ফি প্রদান করে পানির গুনাগুণের রিপোর্ট সংগ্রহ করা যাবে।\r\n', '7 Days', '৭ দিন', '1632373329.png', '1632282830.jpg', 2700, 2300, 50000, '1637417205.PNG', '/irrigation/water-testing-request-form', 1, 1, 1, 1, 0, '2021-09-21 21:53:50', '2022-04-27 05:01:35'),
(27, 'Irrigation Scheme Service', 'সেচ স্কীম সেবা', 9, 8, 'কৃষি জমিতে সেচ প্রদানের জন্য একাধিক কৃষক স্কীম ভূক্ত হয়ে কৃষি মন্ত্রণালয়ের আওতাধীন নির্দিষ্ট প্রকল্পের সেচ যন্ত্রের জন্য আবেদন করতে পারবেন। আবেদন করার ক্ষেত্রে সরকারের নির্দিষ্ট ফরম অনুযায়ী কৃষকের তথ্য প্রদান করে প্রয়োজনীয় ফি প্রদান পূর্বক সেবাটি পাওয়া যাবে।  \r\n', 'কৃষি জমিতে সেচ প্রদানের জন্য একাধিক কৃষক স্কীম ভূক্ত হয়ে কৃষি মন্ত্রণালয়ের আওতাধীন নির্দিষ্ট প্রকল্পের সেচ যন্ত্রের জন্য আবেদন করতে পারবেন। আবেদন করার ক্ষেত্রে সরকারের নির্দিষ্ট ফরম অনুযায়ী কৃষকের তথ্য প্রদান করে প্রয়োজনীয় ফি প্রদান পূর্বক সেবাটি পাওয়া যাবে।  \r\n', '30 Days', '৩০ দিন', '1632373172.png', '1632295601.docx', 500, 200, 100000, '1637379454.jpg', '/irrigation/scheme-application-submit', 1, 1, 1, 1, 0, '2021-09-22 01:26:41', '2022-04-27 05:01:11'),
(28, 'Pump Operator Selection', 'পাম্প অপারেটর নির্বাচন', 9, 8, 'সেচ স্কীমের আওতায় গৃহীত সেচ যন্ত্রের পরিচালনার জন্য পাম্প অপারেটর নির্বাচন করা হয়। অপারেটর নিয়োগ পাওয়ার ক্ষেত্রে যেকোন ব্যক্তি প্রয়োজনীয় তথ্য-উপাত্ত ও ফি প্রদান করে আবেদন করতে পারবেন।\r\n', 'সেচ স্কীমের আওতায় গৃহীত সেচ যন্ত্রের পরিচালনার জন্য পাম্প অপারেটর নির্বাচন করা হয়। অপারেটর নিয়োগ পাওয়ার ক্ষেত্রে যেকোন ব্যক্তি প্রয়োজনীয় তথ্য-উপাত্ত ও ফি প্রদান করে আবেদন করতে পারবেন।\r\n', '30 Days', '৩০ দিন', '1632373478.png', '1632301571.docx', 100, 50, 40000, '1640073842.png', '/irrigation/pump-opt-application', 1, 1, 1, 1, 0, '2021-09-22 03:06:11', '2021-12-21 02:04:02'),
(29, 'Task Management Service', 'টাস্ক ম্যানেজমেন্ট সেবা', 9, 8, 'N/A\r\n', 'প্রযোজ্য নয়', 'N/A', 'প্রযোজ্য নয়', '1632387074.png', '1632301737.docx', 300, 260, 40, '1640074337.PNG', '/my-assign-task', 1, 1, 1, 1, 0, '2021-09-22 03:08:57', '2021-12-21 02:12:17'),
(30, 'Irrigation Card', 'সেচ কার্ড প্রদান', 9, 8, 'সেচ স্কীমের আওতায় গৃহীত সেচ যন্ত্রের মাধ্যমে সেচ দেয়ার জন্য প্রিপেইড কার্ড গ্রহণ করতে হয়। উক্ত কার্ড গ্রহণের জন্য প্রয়োজনীয় তথ্য ও ফি প্রদান করে কার্ডের জন্য আবেদন করা যায়।\r\n', 'সেচ স্কীমের আওতায় গৃহীত সেচ যন্ত্রের মাধ্যমে সেচ দেয়ার জন্য প্রিপেইড কার্ড গ্রহণ করতে হয়। উক্ত কার্ড গ্রহণের জন্য প্রয়োজনীয় তথ্য ও ফি প্রদান করে কার্ডের জন্য আবেদন করা যায়।\r\n', '30 Days', '৩০ দিন', '1632373742.png', '1632301928.docx', 22000, 16000, 100000, '1640074646.PNG', '/irrigation/smart-card-application-form', 1, 1, 1, 1, 0, '2021-09-22 03:12:08', '2021-12-21 02:17:26'),
(31, 'Water Testing Survey', 'পানি পরীক্ষার জরিপ', 9, 8, 'N/A', 'প্রযোজ্য নয়\n', 'N/A', 'প্রযোজ্য নয়', '1632374132.png', '1632303316.docx', 1200, 700, 500, '1640247921.jpg', '-', 1, 1, 1, 0, 0, '2021-09-22 03:35:16', '2021-12-23 02:25:21'),
(32, 'Pump Maintenance', 'পাম্প রক্ষণাবেক্ষণ', 9, 8, 'সেচ যন্ত্রের রক্ষণাবেক্ষণ ও মেরামতের জন্য সেচ স্কীমের আওতাভূক্ত কৃষকগণ বিস্তারিত বিবরণসহ অভিযোগ দাখিল করতে পারবেন। সংস্লিষ্ট কর্মকর্তা অভিযোগ যাচাই-বাছাই পূর্বক পাম্প মেরামতের প্রয়োজনীয় ব্যবস্থা গ্রহণ করবেন।\n', 'সেচ যন্ত্রের রক্ষণাবেক্ষণ ও মেরামতের জন্য সেচ স্কীমের আওতাভূক্ত কৃষকগণ বিস্তারিত বিবরণসহ অভিযোগ দাখিল করতে পারবেন। সংস্লিষ্ট কর্মকর্তা অভিযোগ যাচাই-বাছাই পূর্বক পাম্প মেরামতের প্রয়োজনীয় ব্যবস্থা গ্রহণ করবেন।\n', '20 Days', '২০ দিন', '1632387108.png', '1632303587.docx', 2500, 2200, 300, '1640248625.jpg', '/irrigation/farmer-complain-form', 1, 1, 1, 0, 0, '2021-09-22 03:39:47', '2021-12-23 02:37:05'),
(33, 'Grain Warehousing', 'শস্য গুদামজাতকরণ', 6, 4, 'ক্ষুদ্র ও প্রান্তিক চাষিগণ তাদের উৎপাদিত শস্য সরকারি ব্যবস্থাপনায় গুদামজাতকরণের জন্য আবেদন করতে পারবেন। গুদামজাতকৃত শস্যের পরিমাণের ভিত্তিতে কৃষকগণ ব্যাংক থেকে ঋণও গ্রহণ করতে পারবেন। \n', 'ক্ষুদ্র ও প্রান্তিক চাষিগণ তাদের উৎপাদিত শস্য সরকারি ব্যবস্থাপনায় গুদামজাতকরণের জন্য আবেদন করতে পারবেন। গুদামজাতকৃত শস্যের পরিমাণের ভিত্তিতে কৃষকগণ ব্যাংক থেকে ঋণও গ্রহণ করতে পারবেন। \n', '1 Day', '১ দিন', '1632387165.png', '1632304301.docx', 30000, 28000, 2000, '1640518059.jpg', '/warehouse-farmer/ware-farmer-panel-add-request-form', 1, 1, 1, 1, 0, '2021-09-22 03:51:41', '2021-12-26 05:27:39'),
(34, 'Grain Store in Cold Storage (Potato)', 'হিমাগারে পন্য সংরক্ষণ (আলু)', 6, 4, 'ক্ষুদ্র ও প্রান্তিক চাষিগণ তাদের উৎপাদিত শস্য সরকারি ব্যবস্থাপনায় গুদামজাতকরণের জন্য আবেদন করতে পারবেন। গুদামজাতকৃত শস্যের পরিমাণের ভিত্তিতে কৃষকগণ ব্যাংক থেকে ঋণও গ্রহণ করতে পারবেন। \n', 'ক্ষুদ্র ও প্রান্তিক চাষিগণ তাদের উৎপাদিত শস্য সরকারি ব্যবস্থাপনায় গুদামজাতকরণের জন্য আবেদন করতে পারবেন। গুদামজাতকৃত শস্যের পরিমাণের ভিত্তিতে কৃষকগণ ব্যাংক থেকে ঋণও গ্রহণ করতে পারবেন। \n', '1 Day', '১ দিন', '1632387290.png', '1632304657.docx', 20000, 17000, 3000, '1640518314.JPG', '/warehouse-farmer/ware-farmer-panel-add-request-form', 1, 1, 1, 0, 0, '2021-09-22 03:57:37', '2021-12-26 05:31:54'),
(35, 'Infrastructure Facility', 'অবকাঠামোগত সুবিধা', 6, 4, 'ক্ষুদ্র ও প্রান্তিক চাষিগণ তাদের উৎপাদিত শস্য সরকারি ব্যবস্থাপনায় গুদামজাতকরণের জন্য আবেদন করতে পারবেন। গুদামজাতকৃত শস্যের পরিমাণের ভিত্তিতে কৃষকগণ ব্যাংক থেকে ঋণও গ্রহণ করতে পারবেন। \n', 'ক্ষুদ্র ও প্রান্তিক চাষিগণ তাদের উৎপাদিত শস্য সরকারি ব্যবস্থাপনায় গুদামজাতকরণের জন্য আবেদন করতে পারবেন। গুদামজাতকৃত শস্যের পরিমাণের ভিত্তিতে কৃষকগণ ব্যাংক থেকে ঋণও গ্রহণ করতে পারবেন। \n', '20 Days', '২০ দিন', '1632407560.png', '1632370700.pdf', 81, 20, 61, '1640518507.jpg', '-', 1, 1, 1, 0, 0, '2021-09-22 22:18:20', '2021-12-26 05:35:07'),
(36, 'Germplasm Distribution', 'জার্মপ্লাজম বিতরণ', 8, 4, 'Accelerate agricultural expansion by distributing improved crop seeds among farmers through crop germplasm collection, storage, development, hybridization, evaluation and variety release.', 'ফসলের জার্মপ্লাজম সংগ্রহ, সংরক্ষণ, উন্নয়ন, সংকরায়ন, মূল্যায়ন এবং জাত অবমুক্তিকরণ এর মাধ্যমে উন্নত জাতের ফসলের বীজ কৃষকদের মধ্যে বিতরণ করে কৃষি সম্প্রসারণ ত্বরান্বিত করা।', '5 Days', '৫ কার্যদিবস', '1633769768.png', '1632375388.png', 6000, 5000, 1000, '1640238970.jpg', '-', 1, 1, 1, 0, 0, '2021-09-22 23:36:28', '2021-12-22 23:56:10'),
(37, 'Seed Sale to Farmer', 'কৃষক পর্যায়ে বীজ বিক্রয়', 8, 10, 'Seeds are distributed step by step on the basis of approved allotment as per the demand of the registered farmers. Seed collection can be verified by more or less allotted farmers. However, in the case of farmers, incentives are given above the price of seeds.', 'নিবন্ধিত কৃষকের চাহিদা অনুযায়ী অনুমোদিত বরাদ্দের ভিত্তিতে ধাপে ধাপে বীজ বিতরণ করা হয়। বরাদ্দের কম বা বেশি কৃষক কর্তৃক বীজ সংগ্রহ যাচাই করা যায়। তবে কৃষকের ক্ষেত্রে বীজের ম্যূল্যের উপরে প্রণোদনা দেওয়া হয়।', '1 Day', '১ কার্য দিবস ', '1633769799.png', '1632375677.png', 30000, 25000, 5000, '1640238816.png', '- ', 1, 1, 1, 0, 0, '2021-09-22 23:41:17', '2021-12-22 23:53:36'),
(38, 'Reproduction & Quality Seed Supply', 'প্রজনন ও মানসম্পন্ন বীজ সরবরাহ', 8, 10, 'Seeds are distributed at dealer level to meet the demand of wheat and maize in Bangladesh, to develop high yielding wheat and maize varieties and to increase the productivity of crop by developing high yielding, adaptability dependent wheat and maize varieties and technology to cope with the effects of climate change.', 'বাংলাদেশের গম ও ভুট্টার চাহিদা পূরণ, উচ্চ ফলনশীল গম ও ভুট্টার জাত উদ্ভাবন এবং টেকসই প্রযুক্তি উদ্ভাবনের লক্ষ্যে পরিবর্তিত জলবায়ুর প্রভাব মোকাবেলা করে উচ্চ ফলনশীল, প্রতিকূলতা সহিষ্ণু নির্ভর গম ও ভুট্টার জাত এবং প্রযুক্তি উদ্ভাবন ও উন্নয়ন করে ফসলের উৎপাদনশীলতা বাড়ানোর উদ্দ্যেশ্যে ডিলার পর্যায়ে বীজ বিতরণ করা হয়।', 'Seasonal', 'মৌসুম ভিত্তিক ', '1633769851.png', '1632375804.png', 12000, 11000, 1000, '1640239753.jpg', '- ', 1, 1, 1, 0, 0, '2021-09-22 23:43:24', '2021-12-23 00:09:13'),
(39, 'Seed Distribution to Dealer', 'ডিলার পর্যায়ে বীজ বিতরণ', 8, 10, 'Seeds are distributed step by step on the basis of approved allotment as per the demand of the dealer. Seed collection can be verified by more or less dealer of allotment.', 'ডিলারের চাহিদা অনুযায়ী অনুমোদিত বরাদ্দের ভিত্তিতে ধাপে ধাপে বীজ বিতরণ করা হয়। বরাদ্দের কম বা বেশি ডিলার কর্তৃক বীজ সংগ্রহ যাচাই করা যায়।', '3 Days', '৩ কার্যদিবস', '1633769869.png', '1632375915.png', 8000, 7000, 1000, '1640243696.jpg', '-', 1, 1, 1, 0, 0, '2021-09-22 23:45:15', '2021-12-23 01:14:56'),
(40, 'Online Fertilizer Recommendation', 'অন-লাইন সার সুপারিশ', 8, 6, 'Registered dealers will be able to recommend online for urea and non-urea fertilizers through the online fertilizer recommendation service.', 'অনলাইন সার সুপারিশ সেবার মাধ্যমে নিবন্ধিত / রেজিস্টার ভুক্ত ডিলাররা ইউরিয়া এবং নন ইউরিয়া সারের জন্য অনলাইনে সুপারিশ করতে পারবেন । ', '7 Days', '৭ কার্য দিবস ', '1633769893.png', '1632376290.png', 50000, 42000, 8000, '1640243957.jpg', '/dealer-panel/requisition-form', 1, 1, 1, 0, 0, '2021-09-22 23:51:30', '2021-12-23 01:19:17'),
(41, 'Non-Urea Fertilizer Supply', 'নন-ইউরিয়া সার সরবরাহ', 8, 6, 'Non-urea fertilizer allotted by the Ministry on monthly and program basis is provided through this service.', 'মাসিক এবং কর্মসূচী অনুযায়ী মন্ত্রণালয় কর্তৃক বরাদ্দকৃত নন ইউরিয়া সার এই সেবার মাধ্যমে সরবরাহ করা হয় । ', '....Days', '....দিন', '1632376392.png', '1632376392.png', 25000, 22000, 3000, '1640244404.jpg', '-', 1, 1, 1, 0, 0, '2021-09-22 23:53:12', '2021-12-23 01:26:44'),
(42, 'Market Information Publish/ Online Publication', 'বাজার তথ্য সরবরাহ/অনলাইনে প্রকাশ', 5, 12, 'Manage and disseminate information by analyzing the price and price situation of agricultural products.', 'কৃষি পণ্যের মূল্য ও মূল্য পরিস্থিতি বিশ্লেষণ পূর্বক তথ্য ব্যবস্থাপনা এবং প্রচার করা।', '1 Day', '১ কার্যদিবস', '1633442682.png', '1632376573.png', 0, 0, 170000000, '1640233588.png', '/market-directory/market-daily-price-report', 1, 1, 1, 0, 0, '2021-09-22 23:56:13', '2021-12-22 22:26:28'),
(43, 'Online Market Directory', 'অনলাইন মার্কেট ডাইরেক্টরী', 5, 12, 'Efficient market system is built by building market infrastructure with modern facilities and providing assistance in the supply system of agricultural products.', 'আধুনিক সুবিধা সম্বলিত বাজার অবকাঠামো নির্মান এবং কৃষি পন্যের সরবরাহ ব্যবস্থায় সহায়তা প্রদানের মাধ্যমে দক্ষ বাজার ব্যবস্থা গড়ে তোলা হয়।', '1 Day', '১ কার্যদিবস', '1633442707.png', '1632376648.png', 0, 0, 170000000, '1640234314.jpg', '/market-directory/market-directory-report', 1, 1, 1, 0, 0, '2021-09-22 23:57:28', '2021-12-22 22:38:34'),
(44, 'Subsidy for Sugarcrop Farmer', 'ইক্ষু চাষীদের ভর্তুকি প্রদান', 4, 7, 'Expand sugarcane cultivation and provide subsidy and monitoring to motivate farmers to cultivate sugarcane.', 'আখ চাষকে সম্প্রসারণ করা এবং চাষীদের আখ চাষে উদ্বুদ্ধকরণের জন্য ভর্তুকি প্রদান ও মনিটরিং করা।', '1 time a year', 'বছরে ১ বার ', '1633441927.png', '1632376888.png', 15000, 13000, 2000, '1640246455.jpg', '-', 1, 1, 1, 0, 0, '2021-09-23 00:01:28', '2021-12-23 02:00:55'),
(45, 'Subsidy on agri-machineries purchase', 'কৃষি যন্ত্রপাতি ক্রয়ের ক্ষেত্রে ভর্তুকি প্রদান', 4, 7, 'The Department of Agricultural Extension provides free seeds and fertilizers to marginal farmers. It also provides fertilizers and seeds to farmers with the aim of increasing the production of certain crops and expanding the cultivation of new crops invented.', 'কৃষি সম্প্রসারণ অধিদপ্তর প্রান্তিক কৃষকদের বিনামূল্যে বীজ ও সার প্রদান করে। এছাড়াও নির্দিষ্ট ফসলের উৎপাদন বৃদ্ধি এবং উদ্ভাবিত নতুন ফসলের চাষাবাদ সম্প্রসারণ করার লক্ষ্যে কৃষকদের সার ও বীজ প্রদান করে।', '1 Month', '১ মাস ', '1637378521.png', '1632377212.png', 5000, 3800, 50000, '1640246696.jpg', '/incentive-farmer/subsidy-application-form', 1, 1, 1, 0, 0, '2021-09-23 00:06:52', '2021-12-23 02:04:56'),
(46, 'Grant for Research', 'পিএইচডি বৃত্তি ও গবেষণা অনুদান প্রদান', 4, 7, 'To award cash or any other award to any scientist of the National Agricultural Research System in recognition of innovative or research work to encourage agricultural research, with the approval of the Governing Body, on the basis of specific policies.', 'কৃষি গবেষণাকে উৎসাহিত করার জন্য নবপ্রবর্তনমসূলক (innovative) বা গবেষণামূলক কর্মসম্পাদনের স্বীকৃতিস্বরূপ জাতীয় কৃষি গবেষণা সিস্টেমের যে কোন বিজ্ঞানীকে, সুনির্দিষ্ট নীতিমালার ভিত্তিতে গভর্নিং বডির অনুমোদনক্রমে, সম্মানী হিসাবে নগদ অর্থ অথবা অন্য কোনরূপ পুরস্কার প্রদান করা', '1 month', '১ মাস ', '1633441998.png', '1632377537.png', 500, 350, 150, '1640247614.png', '/grant-panel/application-form-main', 1, 1, 1, 0, 0, '2021-09-23 00:12:17', '2021-12-23 02:20:14'),
(47, 'Virtual Crop Pest Museum', 'ভার্চুয়াল ক্রপ-পেস্ট মিউজিয়াম', 7, 9, 'Data of grains and cereals, insects, insects are preserved. From here all the information including pictures can be found in detail.', ' শস্য ও দানাদার পণ্য, পোকামাকড়, কীটপতঙ্গ এর ডাটা সংরক্ষিত রয়েছে ।  এখান থেকে ছবি সহ অন্যান্য আনুষঙ্গিক সকল তথ্য বিস্তারিত ভাবে জানা যাবে। ', '', '', '1633769636.png', '1632377838.png', 40000, 38000, 2000, '1640518695.jpg', '/virtual-museum/visit_request_physical', 1, 1, 0, 0, 0, '2021-09-23 00:17:18', '2022-02-07 22:57:17'),
(48, 'Virtual Crop Pest Data Bank', 'ভার্চুয়াল ক্রপ-পেস্ট ডাটা ব্যাংক', 7, 9, 'Store all details of grains and grains, insects, pictures of insects and other related information in the database.', ' শস্য ও দানাদার পণ্য, পোকামাকড়, কীটপতঙ্গ এর ছবি সহ অন্যান্য আনুষঙ্গিক সকল বিস্তারিত তথ্য তথ্য ভান্ডারে সংরক্ষণ। ', '', '', '1633769697.png', '1632377956.png', 3500, 3400, 100, '1640518951.jpg', '-', 1, 1, 0, 0, 0, '2021-09-23 00:19:16', '2021-12-26 05:42:31'),
(49, 'Officers/Staff Training', 'কর্মকর্তা/কর্মচারীদের প্রশিক্ষণ ', 10, 11, 'The National Agricultural Training Academy provides various basic, academic and in-house training to agricultural officers at different times of the financial year.', 'জাতীয় কৃষি প্রশিক্ষণ একাডেমিতে অর্থবছরের বিভিন্ন সময়ে কৃষি অফিসারদের জন্য বিভিন্ন রকম বুনিয়াদি, একাডেমিক ও ইনহাউজ প্রশিক্ষণ দেয়া হয়।', '', '', '1633443043.png', '1632378293.png', 14000, 9500, 4500, '1640519441.jfif', '/trainee-panel/profile', 1, 1, 1, 1, 0, '2021-09-23 00:24:53', '2021-12-26 05:50:41'),
(50, 'Venue Use for Trainee', 'প্রশিক্ষণার্থীদের ভবন ব্যবহার', 10, 11, 'Arrangements are made for the stay of trainers and trainees during training or other times as required.', 'প্রয়োজন সাপেক্ষে ট্রেনিং বা অন্যান্য সময়  প্রশিক্ষক ও প্রশিক্ষণার্থীদের থাকার ব্যবস্থা করা হয়।', '.....Days', '.....দিন', '1633443059.png', '1632378491.png', 12000, 9500, 2500, '1640519513.jpg', '-', 1, 1, 1, 0, 0, '2021-09-23 00:28:11', '2021-12-26 05:51:53'),
(51, 'Annual Research Publication', 'বার্ষিক গবেষণা প্রতিবেদন বিতরণ', 3, 12, 'Distribution of Booklets, Leaflets, Minutes, Annual reports and Research reports published by BSRI for research and expansion of cultivation of Sugarcane, Sugar beet, Palm, Date, Golpata, Stevia etc.', 'বিএসআরআই কর্তৃক আখ, সুগারবিট, তাল, খেজুর, গোলপাতা, স্টেভিয়া প্রভৃতির গবেষণা ও  চাষ সম্প্রসারণ এর লক্ষ্যে প্রকশিত বুকলেট, লিফলেট, কার্যবিবরণী, বার্ষিক প্রতিবেদন ও গবেষণা প্রতিবেদন বিতরণ । ', '1 Day', '১ কার্যদিবস', '1633441750.png', '1632378811.png', 1600, 1200, 400, '1640235147.jpg', '/research-farmer/research-management/proposal-submission-form', 1, 1, 0, 0, 0, '2021-09-23 00:33:31', '2022-04-26 06:50:52'),
