(53, 'Seed Moisture, Purity and Germination Test', 'বীজের আর্দ্রতা, বিশুদ্ধতা ও অংকুরোদগম পরীক্ষা', 3, 10, 'Provide certification services to producers for production and distribution of high quality and adversity tolerant varieties.', 'উচ্চ গুনাগুন সম্পন্ন ও প্রতিকুলতা সহিষ্ণু জাতের মানসম্পন্ন বীজ উৎপাদন ও বিতরনে উৎপাদনকারীদের প্রত্যয়ন সেবা প্রদান।', '7-30 Days', '৭-৩০ কার্যদিবস ', '1633441810.png', '1632379098.png', 2400, 2300, 100, '1640237229.jpg', '/research-farmer/seed-certification/field-certification-application', 1, 1, 0, 0, 0, '2021-09-23 00:38:18', '2021-12-22 23:27:09'),
(54, 'Agri Related Research', 'কৃষি বিষয়ক গবেষণা', 3, 12, 'To assist and implement research work in any person or organization and to allocate necessary budget for the implementation of such research proposal and to evaluate and test the research activities.', 'কোন ব্যক্তি বা প্রতিষ্ঠানকে  গবেষণা কার্যে সহায়তা ও বাস্তবায়ন করার এবং উক্তরূপ গবেষণা প্রস্তাব বাস্তবায়নের লক্ষ্যে প্রয়োজনীয় বাজেট বরাদ্দ এবং গবেষণা কার্যক্রম মূল্যায়ন ও পরীক্ষা করা।', 'Continue Process', 'চলমান প্রক্রিয়া', '1633441794.png', '1632379297.png', 15000, 8000, 7000, '1640237596.jpg', '/portal/research-proposal-circular-list', 1, 1, 0, 1, 1, '2021-09-23 00:41:37', '2022-04-27 05:16:15'),
