(81, 'Publication of Agriculture Information Service (Magazine)', 'কৃষি তথ্য সার্ভিসের প্রতিবেদন (ম্যাগাজিন)', 3, 12, 'মাসিক কৃষিকথা পত্রিকাঃ\n\nসেবা প্রদান পদ্ধতিঃ চাহিদা প্রাপ্তি/গ্রাহকের জন্য নির্ধারিত সময়। বিতরণ সরাসরি ও ডাকযোগে।\nসেবার মূল্যঃ প্রতি সংখ্যা ০৫ (পাঁচ) টাকা। ১ বছরের গ্রাহক জনপ্রতি ৫০ টাকা এবং সদস্য সংখ্যা ২০ এর অধিক হলে জনপ্রতি ৪২ টাকা। \n\nসময়সীমাঃ নগদের ক্ষেত্রে তাৎক্ষণিক (মজুদ থাকা সাপেক্ষে), নিয়মিত গ্রাহকের জন্য প্রকাশের ৭ কর্মদিবসের মধ্যে, নতুন গ্রাহকের ক্ষেত্রে গ্রাহক চাঁদা পরিশোধের ২ মাস পর থেকে', 'মাসিক কৃষিকথা পত্রিকাঃ\n\nসেবা প্রদান পদ্ধতিঃ চাহিদা প্রাপ্তি/গ্রাহকের জন্য নির্ধারিত সময়। বিতরণ সরাসরি ও ডাকযোগে।\nসেবার মূল্যঃ প্রতি সংখ্যা ০৫ (পাঁচ) টাকা। ১ বছরের গ্রাহক জনপ্রতি ৫০ টাকা এবং সদস্য সংখ্যা ২০ এর অধিক হলে জনপ্রতি ৪২ টাকা। \n\nসময়সীমাঃ নগদের ক্ষেত্রে তাৎক্ষণিক (মজুদ থাকা সাপেক্ষে), নিয়মিত গ্রাহকের জন্য প্রকাশের ৭ কর্মদিবসের মধ্যে, নতুন গ্রাহকের ক্ষেত্রে গ্রাহক চাঁদা পরিশোধের ২ মাস পর থেকে', '30 Days', '৩০ দিন', '1637747892.png', '1637747892.pdf', 100, 50, 1000, '1637747892.jpg', '/research-farmer/publication-management/publication-proposal-submission', 1, 1, 1, 0, 0, '2021-11-24 03:58:12', '2021-12-07 07:11:20'),
