(83, 'Crop Seed Export Approval', 'ফসলের বীজ রপ্তানি অনুমোদন', 2, 5, 'After receiving the application of the organization, after verification and selection, with the approval of the appropriate authority, the certificate of registration of crop varieties is issued.', 'সংস্থার আবেদন পাওয়ার পর যাচাই-বাছাই পূর্বক যথাযথ কর্তৃপক্ষের অনুমোদন নিয়ে ফসলের জাত নিবন্ধনের প্রত্যয়ন পত্র প্রদান করা হয়।', '10 Days', '১০ কার্যদিবস ', '1640672707.png', NULL, 1000, 700, 500, '1640672707.png', '/lrcpn/application-form?step_id=1&org_id=1&service_id=12', 1, 1, 1, 0, 0, '2021-12-28 00:25:07', '2021-12-28 06:54:14'),
(84, 'Enlistment of agri-based organization or individual', 'কৃষিভিত্তিক প্রতিষ্ঠান বা ব্যক্তির তালিকাভুক্তিকরণ ', 2, 5, 'Listing of agribusiness organizations, federations of agro-based organizations, consortiums, associations, organizations, individuals or organizations involved in contracted farming and marketing systems, co-operative societies', 'কৃষিভিত্তিক ব্যবসায়িক সংগঠন, কৃষিভিত্তিক সংগঠনসমূহের ফেডারেশন, কনসোর্টিয়াম, সমিতি, সংস্থা, চুক্তিবদ্ধ চাষ ও বিপণন ব্যবস্থার সহিত সম্পৃক্ত ব্যক্তি বা প্রতিষ্ঠান, সমবায় সমিতির তালিকাভুক্তিকরণ', '15 Days', '১৫ কার্যদিবস ', '1640678323.png', NULL, 1000, 500, 400, NULL, '/lrcpn/application-form?step_id=1&org_id=13&service_id=20', 1, 1, 1, 0, 0, '2021-12-28 01:58:43', '2022-01-01 23:38:05'),
(85, 'Application for existing tube well license', 'বিদ্যমান নলকূপের লাইসেন্সের জন্য আবেদন ', 2, 5, 'To ensure proper use of irrigation equipment and availability of water, to determine the statistics of irrigation equipment and to ensure proper use of irrigation water, registration of existing irrigation system is ensured through this service at a rate prescribed by the government as per Rule 4-14 of Groundwater Management Rules 198.', 'সেচ যন্ত্রের সঠিক ব্যবহার ও পানির প্রাপ্যতা নিশ্চিত করা , সেচ যন্ত্রের পরিসংখ্যান নির্ণয় ও সেচের পানি সুষ্ঠ ব্যাবহারের জন্য ভূগর্ভস্থ পানির ব্যাবস্থাপনা বিধিমালা ১৯৮৭ এর বিধি ৪-১৪ মোতাবেক সরকার কর্তৃক নির্ধারিত হারে ফি গ্রহন পূর্বক এই সেবার মাধ্যমে বিদ্যমান সেচ যন্ত্রের নিবন্ধন নিশ্চিত করা হয় ।  ', '20 Days', '২০ কার্যদিবস ', '1640683755.png', NULL, 5000, 3500, 2000, NULL, '/lrcpn/application-form?step_id=1&org_id=3&service_id=10', 1, 1, 1, 0, 0, '2021-12-28 03:29:15', '2021-12-28 03:29:15'),
(86, 'Boro Hybrid Rice Seed Import Approval', 'বোরো  হাইব্রিড ধানবীজ আমদানির অনুমোদন', 2, 5, 'Applications are invited from government and non-government organizations for import of Boro hybrid rice seeds. After receiving the application, it is presented in the meeting of the scheduled committee after verification and selection. The Chairman of the Committee is the Executive Chairman, BARC and the Member Secretary is the Chief Seed Scientist, Ministry of Agriculture. At the meeting of the committee, recommendations were accepted on the basis of the application of the institutions regarding the import of Boro Hybrid Rice Seed. The recommendations adopted at the meeting are presented in the documents from the Seed Branch and approval is received from the Hon\'ble Minister. Later, the letter of import approval was issued and sent to all for information and necessary action.', 'বোরো হাইব্রিড ধানবীজ আমদানির জন্য সরকারি ও বেসরকারি প্রতিষ্ঠানসমূহ হতে আবেদনপত্র আহ্বান করা হয়। আবেদন প্রাপ্তির পর যাচাই-বাছাইপূর্বক নির্ধারিত কমিটির সভায় উপস্থাপন করা হয়। কমিটির সভাপতি নির্বাহী চেয়ারম্যান, বিএআরসি এবং সদস্য সচিব প্রধান বীজতত্ত্ববিদ, কৃষি মন্ত্রণালয়। কমিটির সভায় বোরো হাইব্রিড ধানবীজ আমদানির বিষয়ে প্রতিষ্ঠানসমূহের আবেদনের ভিত্তিতে সুপারিশ গ্রহণ করা হয়। সভায় গৃহীত সুপারিশসমূহ বীজ অধিশাখা হতে নথিতে উপস্থাপন করা হয় এবং মাননীয় মন্ত্রী মহোদয় হতে অনুমোদন গ্রহণ করা হয়। পরবর্তীতে আমদানি অনুমোদনের পত্র জারি করে সকলের অবগতি ও প্রয়োজনীয় ব্যবস্থা গ্রহণের জন্য প্রেরণ করা হয়।', '45-50 Working Days', '৪৫-৫০ কার্যদিবস', '1649487329.png', NULL, 1252, 1187, 1500, '1649322005.jpg', '/lrcpn/application-form?step_id=1&org_id=1&service_id=22', 1, 1, 1, 1, 0, '2022-04-07 03:00:05', '2022-04-09 00:55:29');
